          "description": "Union Berlin holt im Spitzenspiel des 5. Spieltages der Fußball-Bundesliga einen Punkt gegen den FC Bayern München. Einen großen Anteil an diesem Erfolg hatte Union-Torwart Frederik Rönnow.  \n\nAlle Highlights aus erster und zweiter Bundesliga findet ihr immer ab Montagmorgen 0 Uhr in der ARD-Mediathek und auf sportschau.de: https://www.sportschau.de/fussball/bundesliga/index.html  \n\nWir freuen uns auf euer Abo bei Instagram: https://www.instagram.com/sportschau  \nCheckt unsere Website aus: https://www.sportschau.de  \nUnsere Sportschau-Themenwelt in der Mediathek: https://www.ardmediathek.de/sport/  \n\nDer 1. FC Union Berlin und der FC Bayern haben sich am Samstag (03.09.2022) 1:1 (1:1) getrennt. Sheraldo Becker brachte Union in der 12. Spielminute in Führung, Joshua Kimmich glich kurz darauf aus. Der Spieler des Spiels aber war Union Berlins Torhüter Frederik Rönnow, an ihm verzweifelten die Bayern. \n\nDamit sind beide Mannschaften auch nach dem fünften Spieltag der Fußball-Bundesliga noch ohne Niederlage. Bei den Bayern ist das so überraschend nicht, Union hatte man das nicht unbedingt zugetraut. \n\nDas Spiel bestimmte in den ersten Minuten der FC Bayern, das erste Tor der Partie erzielte der 1. FC Union Berlin. Nach einem Freistoß von Christopher Trimmel traf Becker mit einer sehenswerten Direktabnahme zur Führung. \n\nDie Antwort der Bayern ließ nicht lange auf sich warten. Kimmich trat eine Ecke - und als die geblockt wurde und ihm der Ball noch einmal vor die Füße fiel, zögerte er nicht. Kimmich traf den Ball mit dem rechten Vollspann, sein Versuch wurde von Trimmel noch leicht abgefälscht - 1:1. \n\nFortan war es das Spiel, das man erwartet hatte. Die Bayern waren spielerisch überlegen, sie hatten mehr Ballbesitz, nur ein Tor erzielten sie nicht. Einmal, es lief die 37. Minute, tauchte Leroy Sané frei vor Torhüter Frederik Rönnow auf. Sané schoss flach, es war die richtige Idee - nur war da eben auch noch Rönnow. Er parierte wunderbar mit dem Fuß. Es sollte nicht die letzte Parade des Dänen sein. \n\nAls es dann kurz vor der Pause noch einmal gefährlich wurde, war Sané wieder beteiligt. Am Strafraumrand kam Sané an den Ball, er schlenzte mit dem linken Fuß, es fehlten nur Zentimeter. \n\nAuch in der zweiten Hälfte waren die Bayern die überlegene Mannschaft, doch der Siegtreffer gelang ihnen nicht mehr. Auch weil Unions Torhüter Rönnow beeindruckte. Beim Schuss von Sadio Mané (56.) war er zur Stelle, später rettete er mit dem Fuß beim Schuss von Alphonso Davies (83.). \n\nZum Helden aller Unioner wurde Rönnow dann, als er in der dritten Minute der Nachspielzeit einen Kopfball von Mané aus dem Winkel fischte. Es war eine Parade, die die Bayern so schnell nicht vergessen werden. \n\nUnd Union? Die Mannschaft von Urs Fischer hielt dem Druck stand - und hatte in der Schlussphase eine richtige gute Möglichkeit, um auch noch den Siegtreffer zu erzielen. Der eingewechselte Jamie Leweling luchste Dayot Upamecano den Ball ab und spurtete dann in den Strafraum. Leweling entschied sich für einen Schuss auf die kurze Ecke, nur war da schon Manuel Neuer (75.). \n\nStartaufstellungen:  \nUnion: Rönnow - Jaeckel, Knoche, Doekhi - Trimmel, R. Khedira, Ryerson, Thorsby, Schäfer - Behrens, Becker \nTrainer: Urs Fischer \n\nBayern: Neuer - Pavard, Upamecano, de Ligt, Davies - Kimmich, Sabitzer, Coman, Musiala, Sané - Mané \nTrainer: Julian Nagelsmann  \n\nSchiedsrichter: Frank Willenborg \n\n#bundesliga"
        }
